import React from "react";
import {
  Card,
  CardContent,
  Typography,
  LinearProgress,
  Box,
} from "@mui/material";

const SkillProgress = ({ student }) => {
  return (
    <Card>
      <CardContent>
        <Typography variant="h6" gutterBottom>
          {student.name}'s Skill Progress
        </Typography>
        {Object.entries(student.skills).map(([skill, value]) => (
          <Box key={skill} mb={2}>
            <Typography variant="body1">{skill}</Typography>
            <LinearProgress
              variant="determinate"
              value={value}
              sx={{ height: 10, borderRadius: 5 }}
            />
            <Typography variant="body2" color="textSecondary">
              {value}%
            </Typography>
          </Box>
        ))}
      </CardContent>
    </Card>
  );
};

export default SkillProgress;
